import { Button, StyleSheet, Text, View, TextInput, Pressable } from 'react-native';

function ViewClients(params) {

    return (
        <View style={styles.container}>
            {
                params.clients.map((c) => <Pressable key={c.clientName + c.contactEmail} onPress={()=>alert("Pressed")}><Text >{c.clientName}</Text></Pressable>)
            }
        </View>
    )
}

export default ViewClients;

const styles = StyleSheet.create({
    container: {
      flex: 1,
      backgroundColor: '#fff',
      alignItems: 'center',
      justifyContent: 'center',
    },
    input: {
      height: 40,
      margin: 12,
      borderWidth: 1,
      padding: 10,
    },
  });
